import classes from './Layout.module.css'
import Navbar from './Navbar'

function Layout(props){
    return(
        <div class = "container">
            <div class="row">
                <div class={"col"}> Col One </div>
                <div className={"col"}> {props.children} </div>
            </div>

        </div>
    )
}

export default Layout
